import React from 'react';

interface HeaderProps {
  currentPage: 'upload' | 'search' | 'generate';
  onNavigate: (page: 'upload' | 'search' | 'generate') => void;
  documentCount: number;
}

const Header: React.FC<HeaderProps> = ({ currentPage, onNavigate, documentCount }) => {
  return (
    <header style={{
      background: 'linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%)',
      color: '#ffffff',
      padding: '0',
      boxShadow: '0 4px 20px rgba(0, 0, 0, 0.3)',
      marginBottom: '30px',
      position: 'relative',
      borderBottom: '1px solid rgba(255,255,255,0.1)'
    }}>
      {/* 微妙な背景テクスチャ */}
      <div style={{
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        bottom: '0',
        background: `
          repeating-linear-gradient(
            90deg,
            transparent,
            transparent 2px,
            rgba(255,255,255,0.03) 2px,
            rgba(255,255,255,0.03) 4px
          )
        `,
        opacity: 0.5
      }} />

      <div style={{
        maxWidth: '1200px',
        margin: '0 auto',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '0 20px',
        position: 'relative',
        zIndex: 1
      }}>
        {/* ロゴ・タイトル */}
        <div style={{ padding: '20px 0' }}>
          <h1 style={{
            margin: '0',
            fontSize: '28px',
            fontWeight: '600',
            color: '#ffffff',
            letterSpacing: '0.5px'
          }}>
            📑 DocuMind Pro
          </h1>
          <p style={{
            margin: '4px 0 0 0',
            fontSize: '14px',
            color: '#b8c6db',
            fontWeight: '400'
          }}>
            Enterprise Document Intelligence Platform
          </p>
        </div>

        {/* ナビゲーション */}
        <nav style={{ display: 'flex', gap: '1px' }}>
          <button
            onClick={() => onNavigate('upload')}
            style={{
              background: currentPage === 'upload' ? '#2c5aa0' : 'transparent',
              color: currentPage === 'upload' ? '#ffffff' : '#b8c6db',
              border: '1px solid rgba(255,255,255,0.1)',
              padding: '12px 20px',
              cursor: 'pointer',
              fontSize: '14px',
              fontWeight: '500',
              borderRadius: '6px 0 0 6px',
              transition: 'all 0.2s ease',
              borderRight: 'none'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.background = 'rgba(255,255,255,0.1)';
                e.currentTarget.style.color = '#ffffff';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.background = 'transparent';
                e.currentTarget.style.color = '#b8c6db';
              }
            }}
          >
            📤 アップロード
          </button>
          <button
            onClick={() => onNavigate('search')}
            style={{
              background: currentPage === 'search' ? '#2c5aa0' : 'transparent',
              color: currentPage === 'search' ? '#ffffff' : '#b8c6db',
              border: '1px solid rgba(255,255,255,0.1)',
              padding: '12px 20px',
              cursor: 'pointer',
              fontSize: '14px',
              fontWeight: '500',
              borderRadius: '0',
              transition: 'all 0.2s ease',
              borderRight: 'none',
              borderLeft: 'none'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.background = 'rgba(255,255,255,0.1)';
                e.currentTarget.style.color = '#ffffff';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.background = 'transparent';
                e.currentTarget.style.color = '#b8c6db';
              }
            }}
          >
            🔍 検索
          </button>
          <button
            onClick={() => onNavigate('generate')}
            style={{
              background: currentPage === 'generate' ? '#2c5aa0' : 'transparent',
              color: currentPage === 'generate' ? '#ffffff' : '#b8c6db',
              border: '1px solid rgba(255,255,255,0.1)',
              padding: '12px 20px',
              cursor: 'pointer',
              fontSize: '14px',
              fontWeight: '500',
              borderRadius: '0 6px 6px 0',
              transition: 'all 0.2s ease',
              borderLeft: 'none'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.background = 'rgba(255,255,255,0.1)';
                e.currentTarget.style.color = '#ffffff';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.background = 'transparent';
                e.currentTarget.style.color = '#b8c6db';
              }
            }}
          >
            🤖 資料生成
          </button>
        </nav>

        {/* ドキュメント数表示 */}
        <div style={{
          background: 'rgba(44, 90, 160, 0.8)',
          border: '1px solid rgba(255,255,255,0.2)',
          padding: '8px 16px',
          borderRadius: '4px',
          fontSize: '13px',
          fontWeight: '500',
          display: 'flex',
          alignItems: 'center',
          gap: '6px',
          color: '#ffffff'
        }}>
          <span style={{ fontSize: '14px' }}>📄</span>
          <span>{documentCount}件</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
